import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';

function LoginComponent() {
	return (
		<div>
			<Container className="Login-component">
				<Row>
					<Col>
						<hi>hello world</hi>
					</Col>
				</Row>
			</Container>
		</div>
	);
}

export default LoginComponent;
